import './App.css';

function App() {
  return (
    <div className="App">
      <h1>An electricity bill system</h1>
      <h2>have a bunch of users</h2>
      <h3>Each user</h3>
      <p>- id</p>
      <p>- name</p>
      <p>- address</p>
      <p>- nill/usage</p>
      <p>- payed last month bool</p>

      <h3>
        Check if the user paid last month otherwise add a 10% fee
        Maybe use bootstrap
      </h3>

      <h2>https://www.youtube.com/watch?v=re3OIOr9dJI&t=2454s</h2>
    </div>
  );
}

export default App;
